package com.yadlings.itemservice.Services;

import lombok.extern.log4j.Log4j2;
import org.junit.jupiter.api.BeforeAll;
import org.junit.jupiter.api.Order;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.TestInstance;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.beans.factory.annotation.Value;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.core.io.Resource;
import org.springframework.mock.web.MockMultipartFile;


import java.util.Arrays;
import java.util.UUID;

import static org.junit.jupiter.api.Assertions.*;
@SpringBootTest
@TestInstance(TestInstance.Lifecycle.PER_CLASS)
@Log4j2
class CloudStorageServiceTest {

   @Autowired
    CloudStorageService cloudStorageService;
    @Value("${azure.storage.blob-endpoint}") String endPoint;
    MockMultipartFile multipartFile;
    String actualLink;
    String filename;
    @BeforeAll
    void init() throws Exception{
        filename = UUID.randomUUID().toString();
        var image = "data:image/jpeg;base64,";
        multipartFile = new MockMultipartFile(filename, image.getBytes());
        actualLink ="";
    }
    @Test
    void uploadAndDelete() throws Exception{
        //Upload part
        actualLink = cloudStorageService.uploadToAzureStorage(multipartFile);
        assertTrue(actualLink.startsWith(endPoint));
        assertTrue(actualLink.endsWith(filename));
        //DELETE part
        cloudStorageService.delete(actualLink);
    }
}
